import React from 'react';
import './Signup.css';


 const Signup = () => { 
    let arrayFieldinput=[];
    let inputtyped='';

    const Inputtyped=(e)=>{
        inputtyped=e.target.value
    }

    const pushinginputtyped = (e)=>{
        e.preventDefault();
        arrayFieldinput.push(inputtyped);
    }

    

    
     
    const verifysignup = (e) => {
        e.preventDefault();
        if( (arrayFieldinput[ arrayFieldinput.length-1]=== arrayFieldinput[ arrayFieldinput.length-2])&&(arrayFieldinput.length===6)){
          alert('Note');
          
        }
    }
      
        
   
    
    return (
        <div className="signup">
         <form onSubmit={verifysignup}>
         <p className="text">Name  :</p>
         <div className="inputbox"><input  type="text" onChange={Inputtyped} onClick={pushinginputtyped}/> </div>
         <p className="text">Email-Id :</p>
         <div className="inputbox"><input  type="email" onChange={Inputtyped} onClick={pushinginputtyped}/> </div>
         <p className="text">Phone number :</p>
         <div className="inputbox"><input  type="number" pattern=".{10,}" onChange={Inputtyped} onClick={pushinginputtyped}/> </div>
         <p className="text">Password :</p>
         <div className="inputbox"><input  type="text" onChange={Inputtyped} onClick={pushinginputtyped}/> </div>
         <p className="text">Confirm Password :</p>
         <div className="inputbox"><input type="text" onChange={Inputtyped} onClick={pushinginputtyped}/> </div><br/>
         <input type="submit"/>
         </form>
        </div>
       
    );

}
export default Signup;
